"""
给定一个字符串 s ，请你找出其中不含有重复字符的 最长子串 的长度。

示例 1:

输入: s = "abcabcbb"
输出: 3
解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。

来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/longest-substring-without-repeating-characters
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
"""


class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        """
        无重复字符的最长子串
        解法：
            1. 动态规划方法（Leetcode会超时，不采用，见文件尾）
            2. 窗口滑动算法

        :param s:
        :return:
        """

        # *****************************方法三、滑动窗口*******************
        # 记录最长子串，默认0
        max_length_int = 0
        # 窗口大小
        current_win_int = 0
        # 初始化无序字符集合
        str_set = set()
        # 待删除字符下标
        del_num_int = 0

        for i in range(len(s)):
            # 窗口数+1
            current_win_int += 1

            while s[i] in str_set:
                # 若加入s[i]字符，窗口内将有重复
                # 按字符删除窗口内字符，从s字符串下标0字符开始删
                str_set.remove(s[del_num_int])
                del_num_int += 1
                # 窗口数-1
                current_win_int -= 1
            # 从s[i-current_win_int+1 : i]为前i-1个字符中的最大不重复子串
            max_length_int = max(max_length_int, current_win_int)
            # 将s[i]加入字符合集
            str_set.add(s[i])

        return max_length_int



